import { useState } from "react";


function Square({ index }) {

    const [value, setValue] = useState(null);

    function clickHandler() {
        setValue('X')
    }

    function setInitialValue() {
        console.log(index);
        
    }
   
    return <button className="square" onLoad={setInitialValue} onClick={clickHandler}>{value}</button>
}


export default function Board() {
    return (
        <>
            <div className="board-row">
                <Square />
                <Square />
                <Square />
            </div>
            <div className="board-row">
                <Square />
                <Square />
                <Square />
            </div>
            <div className="board-row">
                <Square />
                <Square />
                <Square />
            </div>
        </>
    )
};
